pub fn lookup(name: &str) -> Option<Instruction> {
  INSTRUCTION_BY_NAME
    .binary_search_by(|(n, _)| n.cmp(&name))
    .ok()
    .map(|idx| INSTRUCTION_BY_NAME[idx].1)
}

pub fn lookup_normalized(name: &str) -> Option<Instruction> {
  lookup(&name.to_ascii_lowercase())
}
